import React from 'react';
import { Card, CardBody, CardTitle, CardText, Button } from 'reactstrap';

const StudentDetails = ({ student }) => {
  return (
    <Card>
      <CardBody>
        <CardTitle tag="h5">{student.name}</CardTitle>
        <CardText><strong>Matrícula:</strong> {student.registration}</CardText>
        <CardText><strong>Nota Média:</strong> {student.averageGrade}</CardText>
        <CardText><strong>Notas:</strong></CardText>
        <ul>
          {Object.entries(student.grades).map(([subject, grade]) => (
            <li key={subject}>{subject}: {grade}</li>
          ))}
        </ul>
      </CardBody>
    </Card>
  );
};

export default StudentDetails;
